/** @jsx jsx */
import { jsx } from "theme-ui";
import { ShowEpisode } from "src/_models/shows.model";

interface IProp {
    episode: ShowEpisode;
}

const ListItem: React.FC<IProp> = ({ episode }) => {
    return (
        <li className="col-3">
            <div
                sx={{
                    variant: "containers.card",
                    bg: "whitesmoke",
                }}
                className="col-12"
            >
                {episode.name}
            </div>
        </li>
    );
};

export default ListItem;
